@SHossain check out portainer for a GUI to docker containers.  Very easy to manage.
I set up my dev web stuff moving away from easy engine in dev env for GUI mgmt (but keeping ee for prod)

Portainer doesnâ€™t allow orchestration of so many nodes, so there is another foss product called rancher.  With rancher orchestration across node clusters holding containers will get the desired testing.
